  // 2. Let processResponseEndOfBody be the following steps:
  const processResponseEndOfBody = () => {
    // 1. Set fetchParams‚Äôs request‚Äôs done flag.
    fetchParams.request.done = true

    // If fetchParams‚Äôs process response end-of-body is not null,
    // then queue a fetch task to run fetchParams‚Äôs process response
    // end-of-body given response with fetchParams‚Äôs task destination.
    if (fetchParams.processResponseEndOfBody != null) {
      queueMicrotask(() => fetchParams.processResponseEndOfBody(response))
    }
  }

